    'Udało się zlokalizować Twoje urządzenie, sprawdź czy pozycja na mapie się zgadza. Kolorem niebieskim zaznaczony jest obszar wyznaczający dokładność pomiaru. Jeżeli urządzenie błędnie wskazało lokalizacje to spróbuj zlokalizować je ponownie lub przeciągnij i upuść marker na właściwe miejsce.' => 'Es ist gelungen, Ihr Gerät zu lokalisieren, prüfen Sie die Position auf der Mappe. Die blau markierten Bereich ist die Definition der Messgenauigkeit. Wenn Ihre Lokalisierung falsch markiert ist, probieren Sie noch niemal oder markieren Sie allein die richtige Stellung.',
