    'dziadek' => 'Der Opa',
    'Moja mama była osobą niezwykle drogą memu sercu - kochającą, dobrą i mądrą. Z wielką pokorą znosiła wszelkie przeciwności losu, do ostatniej chwili cieszyła się życiem, zawsze na pierwszym miejscu stawiając dzieci i wnuki, którym bezgranicznie się poświęcała. To ona nauczyła mnie wrażliwości na drugiego człowieka i szacunku dla historii, to dzięki niej nasza rodzina potrafi trzymać się razem. Okazywała nam miłość i czułość, ale potrafiła być także wymagająca, wyrażając troskę o  naszą przyszłość. To dzięki niej nauczyłam się życia. Dziękuję Ci za to, kochana Mamusiu...' => 'Meine Mutter war eine Person sehr wichtig zu meinem Herzen - eine liebevolle , gute und kluge Frau. Mit großer Bescheidenheit erträgt Sie die Widrigkeiten, bis zur letzten Minute hat Sie das Leben genossen, immer in erster Linie waren für sie die Kinder und Enkelkinder. Sie lehrte mich Sensibilität für andere und Respekt für die Geschichte, sie macht, dass unsere Familie immer zusammen bleiben kann. Sie zeigte uns Liebe und Zärtlichkeit. Dank ihr habe ich das Leben gelernt. Vielen Dank für alles, liebe Mama ...',
    'Mój ojciec był wspaniałym człowiekiem, który ofiarował mi wspaniałe dzieciństwo, wykształcił i wychował mnie na człowieka, którym jestem dzisiaj. Żył pięknie i szczerze, potrafił być współczujący i wrażliwy, a równocześnie umiał także wymagać. Niósł pomoc w trudnych chwilach, wspierał całą naszą rodzinę i przyjaciół ciepłem, mądrością oraz dobrym słowem. Jego sprawiedliwość i wyrozumiałość dawała poczucie bezpieczeństwa, bo zawsze trzeźwo oceniał, ale nigdy nie był krzywdzący w swoich osądach. Zasiał ziarno kultury i dobrego wychowania, za co dozgonnie będę mu wdzięczny. Żegnaj, Tato...' => 'Mein Vater war ein großer Mann, der mir eine wunderbare Kindheit gab, entwickelt und erzog mich zu dem Mann, der ich heute bin. Er lebte schön und ehrlich, konnte mitfühlend und sensibel sein aber auch forderte er viel. Er trug Hilfe in schwierigen Zeiten, er hat auch unsere Familie und Freunde mit Wärme, Weisheit und gutes Wort unterstützt. Seine Gerechtigkeit und Verständnis gab ein Gefühl der Sicherheit, weil er immer nüchtern beurteilt, aber er war nie unfair, in seinen Urteilen. Sie pflanzte einen Samen der Kultur und gute Manieren, für die ich ihm ewig dankbar sein werde. Auf Wiedersehen , Dad ...',
    'Moja babcia była osobą niezwykle drogą memu sercu - kochającą, dobrą i mądrą. Z wielką pokorą znosiła wszelkie przeciwności losu, do ostatniej chwili cieszyła się życiem, zawsze na pierwszym miejscu stawiając dzieci i wnuki, którym bezgranicznie się poświęcała. To ona nauczyła mnie wrażliwości na drugiego człowieka i szacunku dla historii, to dzięki niej nasza rodzina potrafi trzymać się razem. Okazywała nam miłość i czułość, ale potrafiła być także wymagająca, wyrażając troskę o naszą przyszłość. To dzięki niej nauczyłam się życia. Dziękuję Ci za to, kochana Babciu...' => 'Meine Großmutter war eine Person, die sehr wichtig für mich war. - eine liebevolle , gute und kluge Frau. Mit großer Bescheidenheit erträgt Sie die Widrigkeiten, bis zur letzten Minute hat Sie das Leben genossen, immer in erster Linie waren für sie die Kinder und Enkelkinder. Sie lehrte mich Sensibilität für andere und Respekt für die Geschichte, sie macht, dass unsere Familie immer zusammen bleiben kann. Sie zeigte uns Liebe und Zärtlichkeit. Dank ihr habe ich das Leben gelernt. Vielen Dank dafür, meine liebe Großmutter ...',
    'Mój dziadek do końca pozostał szlachetnym człowiekiem, autorytetem dla mnie i całej naszej rodziny. Mimo że wiele przeżył, zawsze potrafił zachować pogodę ducha i nigdy nie szczędził dobrego słowa, dzieląc się swoim doświadczeniem i mądrością. Zapamiętam go jako szlachetnego, sprawiedliwego i życzliwego wszystkim człowieka, który przez całe życie starał się uczyć nas siły, wiary oraz pracowitości. Jako oddany patriota, ojciec i dziadek zdobył szacunek wielu i pozostawił moc wspaniałych wspomnień, które na zawsze pozostaną w naszych sercach. To dzięki niemu nauczyłam się życia. Dziękuję Ci za to, ukochany Dziadku...' => 'Mein Großvater blieb bis zum Ende eines edlen Mannes, Autorität für mich und unsere ganze Familie. Obwohl er viele überlebte , konnte er immer ruhig sein und nie ein gutes Wort gescheut, seine Erfahrungen und Weisheiten zu teilen. Ich werde ihn als edler erinnern, gerechten und gütigen allem ein Mann, der sein ganzes Leben lang versucht, uns die Kraft zu lehren, den Glauben und harte Arbeit. Als ergebener Patriot, Vater und Großvater verdient den Respekt vieler, und verließ die Macht der großen Erinnerungen, die für immer in unseren Herzen bleiben. Dank ihm habe ich das Leben gelernt. Vielen Dank dafür, liebe Opa ...',
