    'Podaj kod aktywacyjny, który znajduje się w liście. Jeżeli nie posiadasz kodu epado możesz zakupić jeden z pakietów online, zostanie on wysłany do Ciebie pocztą. W przesyłce będzie znajdował się kod aktywacyjny, który trzeba będzie wpisać w poniższe pole. Istnieje również możliwość zakupu kodu u jednego z naszych partnerów' => 'Geben Sie den Aktivierungscode, der in der Liste ist. Wenn Sie keinen Code haben, kaufen Sie online eines der Pakete und wird es Ihnen per Post senden. In der Sendung wird sich Aktivierungscode befinden, die Sie in diesem Feld eingeben müssen. Sie können auch einen Code bei einem aus unserem Partner kaufen.',
