    'Witamy w Epado, jeśli zakupiłeś i posiadasz jedną z kopert. dodaj stronę i zapisz ją a następnie wpisz poufny kod aktywacyjny znajdujący się w kopercie. Strona zacznie być wyświetlana w wynikach wyszukiwania.' => 'Herzlich Willkommen in Epado, wenn Sie einen Umschlag haben, fügen Sie die Seite hinzu. Dann schreiben Sie die vertrauliche Aktivierungscode und die Seite sollte in den Suchergebnissen angezeigt werden.',
    'Jeśli nie posiadasz koperty z kodem aktywacyjnym. Dodaj stronę, uzupełnij formularze, dodaj zdjęcia i zapisz ją. Po dokonaniu  wyboru jednego z pakietów, opłać i oczekuj na przesyłkę z fizycznym kodem Epado, który nakleisz na nagrobku.' => 'Wenn Sie keinen Umschlag mit Aktivierungcode haben, fügen Sie die Seite hinzu. Dann füllen Sie das Formular aus, fügen Sie die Fotos hinzu und schreiben Sie das auf. Wenn Sie schon ein Paket wählen, müssen Sie es zuerst bezahlen und dann erwarten Sie auf Postsendung mit Epado- Code, die Sie auf Grobmal bekleben.',
