    'Babcia' => 'Grandmother',
    'Dziadek' => 'Grandfather',
    'Moja mama była osobą niezwykle drogą memu sercu - kochającą, dobrą i mądrą. Z wielką pokorą znosiła wszelkie przeciwności losu, do ostatniej chwili cieszyła się życiem, zawsze na pierwszym miejscu stawiając dzieci i wnuki, którym bezgranicznie się poświęcała. To ona nauczyła mnie wrażliwości na drugiego człowieka i szacunku dla historii, to dzięki niej nasza rodzina potrafi trzymać się razem. Okazywała nam miłość i czułość, ale potrafiła być także wymagająca, wyrażając troskę o  naszą przyszłość. To dzięki niej nauczyłam się życia. Dziękuję Ci za to, kochana Mamusiu...' => 'My mother was a person extremely important to my heart - a loving, good and wise. With great humility she endured all the adversity, until the last minute she enjoyed life, always on the first place putting her children and grandchildren, which she utterly devoted. She taught me sensitivity to others and respect for the history, only by her our family can stay together. She showed us love and tenderness, but she could also be demanding, expressing concern for our future. Thanks to her I learned life. Thank you for that, my dear Thank you for this, dear Mommy...',
    'Mój ojciec był wspaniałym człowiekiem, który ofiarował mi wspaniałe dzieciństwo, wykształcił i wychował mnie na człowieka, którym jestem dzisiaj. Żył pięknie i szczerze, potrafił być współczujący i wrażliwy, a równocześnie umiał także wymagać. Niósł pomoc w trudnych chwilach, wspierał całą naszą rodzinę i przyjaciół ciepłem, mądrością oraz dobrym słowem. Jego sprawiedliwość i wyrozumiałość dawała poczucie bezpieczeństwa, bo zawsze trzeźwo oceniał, ale nigdy nie był krzywdzący w swoich osądach. Zasiał ziarno kultury i dobrego wychowania, za co dozgonnie będę mu wdzięczny. Żegnaj, Tato...' => 'My father was a great man, who gave me a wonderful childhood, developed and brought me to the man that I am today. He lived beautifully and honestly, he could be compassionate and sensitive, while he could also require. He carried help in difficult times, support our family and friends with warmth, wisdom and good word. His justice and understanding gave a sense of security, because I always soberly assessed, but he was never unfair in their judgments. She planted a seed of culture and good manners, for which I will be eternally grateful to him. Goodbye, Dad...',
    'Moja babcia była osobą niezwykle drogą memu sercu - kochającą, dobrą i mądrą. Z wielką pokorą znosiła wszelkie przeciwności losu, do ostatniej chwili cieszyła się życiem, zawsze na pierwszym miejscu stawiając dzieci i wnuki, którym bezgranicznie się poświęcała. To ona nauczyła mnie wrażliwości na drugiego człowieka i szacunku dla historii, to dzięki niej nasza rodzina potrafi trzymać się razem. Okazywała nam miłość i czułość, ale potrafiła być także wymagająca, wyrażając troskę o naszą przyszłość. To dzięki niej nauczyłam się życia. Dziękuję Ci za to, kochana Babciu...' => 'My grandmother was a person extremely important to my heart - a loving, good and wise. With great humility she endured all the adversity, until the last minute she enjoyed life, always on the first place putting her children and grandchildren, which she utterly devoted. She taught me sensitivity to others and respect for the history, only by her our family can stay together. She showed us love and tenderness, but she could also be demanding, expressing concern for our future. Thanks to her I learned life. Thank you for that, my dear Grandma ...',
    'Mój dziadek do końca pozostał szlachetnym człowiekiem, autorytetem dla mnie i całej naszej rodziny. Mimo że wiele przeżył, zawsze potrafił zachować pogodę ducha i nigdy nie szczędził dobrego słowa, dzieląc się swoim doświadczeniem i mądrością. Zapamiętam go jako szlachetnego, sprawiedliwego i życzliwego wszystkim człowieka, który przez całe życie starał się uczyć nas siły, wiary oraz pracowitości. Jako oddany patriota, ojciec i dziadek zdobył szacunek wielu i pozostawił moc wspaniałych wspomnień, które na zawsze pozostaną w naszych sercach. To dzięki niemu nauczyłam się życia. Dziękuję Ci za to, ukochany Dziadku...' => 'My grandfather stayed a noble man to the end, an authority for me and our whole family. Although he survived a lot, he could always be serene and never spared a good word, sharing his experience and wisdom. I\'ll remember him as a noble, just and benevolent of all, a man who throughout his whole life tried to teach us strength, faith and hard work. As a devoted patriot, father and grandfather earned the respect of many, and left the power of great memories, that will forever remain in our hearts. Thanks to him I learned life. Thank you for that, beloved Grandpa ...',
